import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
	faBolt,
	faBuilding,
	faBatteryFull,
	faBatteryEmpty,
} from "@fortawesome/free-solid-svg-icons";

const GridBatteryBuildingSupply = ({ ...data }) => {
	let batteryIcon;
	let batteryColorClass;

	return (
		<div className="p-10 m-20 bg-slate-300 rounded-lg flex-col justify-around">
			<div className="flex justify-around">
				<div>
					<div className="flex items-center justify-center shadow-sm rounded-full bg-slate-200 w-32 h-32">
						<FontAwesomeIcon
							icon={faBolt}
							className="text-blue-500 text-3xl"
						/>
					</div>
					<div className="mt-4 text-cente text-smr">
						<p className="text-sm text-gray-600">
							Available Capacity
						</p>
					</div>
				</div>
				<div>
					<div className="flex items-center justify-center shadow-sm rounded-full bg-slate-200 w-32 h-32">
						<FontAwesomeIcon
							icon={faBolt}
							className="text-blue-500 text-3xl"
						/>
					</div>
					<div className="mt-4 text-cente text-smr">
						<p className="text-sm text-gray-600">
							Available Capacity
						</p>
					</div>
				</div>
			</div>
		</div>
	);
};

export default GridBatteryBuildingSupply;
